import React from 'react';
import './App.css';
import Header from './Header';
import Sidebar from './Sidebar';
import Feed from './Feed';

function App() {
  return (
    <div className="app">

      <Header />

      {/* app body */}
        <div className="app_body">
          <Sidebar />
          <Feed />
        {/* right side widgits */}
        </div>
    </div>
  );
}

export default App;
